interface Props {
  name?: string;
}

export class App {
  el: HTMLElement;
  props: Props;

  constructor(el, props: Props = {}) {
    this.el = el;
    this.props = props;

    this.el.innerHTML = this.render();
  }

  render(): string {
    console.log("render");
    return /* html */ `
      <div>
        hi {this.props.name} from tsx!
      </div>
    `;
  }
}
